import React from "react";
import logo from "../Images/react-logo.png"; // I am using this img

export default function Header() {
  // header function
  return (
    <header>
      <nav className="flex flex-row shadow-md bg-[#21222A]">
        <img
          className="flex items-center basis-1/12 m-2 w-[60px]"
          src={logo}
          alt="React Logo"
        />
        <h1 className="flex items-center font-bold text-2xl text-sky-400 font-inter">
          ReactFacts
        </h1>
        {/*React logo*/}
        <h1 className="flex basis-11/12 justify-end items-center font-inter">
          React - Project 1
        </h1>
      </nav>
    </header>
  );
}
